INSERT INTO `t0111_about_character_en` VALUES ('anusha','anusha','Boys, boys, boys…!!','','2015-05-26 19:19:31',NULL,NULL),('bella','bella','Awak dah dengar pasal…?','','2015-05-26 19:19:31',NULL,NULL),('cik-soo','cik-soo','Awak nak cuba?','','2015-05-26 19:19:31',NULL,NULL),('cikgu-ayu','cikgu-ayu','OH!! Yes, that\'s what I meant.','Over the break, Zizang (her longtime admirer from Terengganu) proposed to Ayu. It was a very grand affair that was witnessed by many of the villagers, but she turned him down. Ouch.','2015-05-26 19:19:31',NULL,NULL),('cikgu-bedah','cikgu-bedah','Squeeze me!','','2015-05-26 19:19:31',NULL,NULL),('encik-ariff','cikgu-ariff','Are you okay, Ayu?','','2015-05-26 19:19:31',NULL,NULL),('henry-middleton','henry-middleton','A problem shared is a problem halved.','Henry wanted to be the host of a local food programme. He travelled around Malaysia to familiarise himself with the local dishes - only to be told that he was too big for the role. What a bummer!','2015-05-26 19:19:31',NULL,NULL),('jibam','jibam','SAKIT PERUT!','','2015-05-26 19:19:31',NULL,NULL),('jojie','jojie','Tepi sikit!','Jojie spent the holidays creating YouTube tutorials on different ways to wear a hijab stylishly. Helping her with the project was none other than our very own Mazlee.','2015-05-26 19:19:31',NULL,NULL),('mazlee','mazlee','Oh My Gucci!','','2015-05-26 19:19:31',NULL,NULL),('puan-aida','puan-aida','Students should be honest and respectful to others.','','2015-05-26 19:19:31',NULL,NULL),('qila','qila','Can you help me fill up this survey form?','','2015-05-26 19:19:31',NULL,NULL),('sarjan-bin-mejar','sarjan-bin-mejar','OIT! *whistle*','','2015-05-26 19:19:31',NULL,NULL),('sayur','sayur','Sedapnya sayur ini!','','2015-05-26 19:19:31',NULL,NULL),('see-yew-soon','see-yew-soon','Mesti boleh dapat!','In Singapore, See Yew Soon worked at a Singaporean food court but was discovered by custom officers who then deported him back to Malaysia. No matter - we are just happy to have him home!','2015-05-26 19:19:31',NULL,NULL),('taylor-marie-smith','taylor-marie-smith','I love Malaysia so much!','Ever wondered where Putri went? Well, it turns out that Putri, too, enrolled in the same exchange programme. She is currently living with Taylor\'s family in the USA!','2015-05-26 19:19:31',NULL,NULL),('zack','zack','PEACE!','Zack has been working on a single and plans to pitch it to a record label. The name of the song? \"Zack Ada Kelas\" - how classy is that?','2015-05-26 19:19:31',NULL,NULL),('zeeq','zeeq','But I don\'t want…','','2015-05-26 19:19:31',NULL,NULL);
