INSERT INTO `t0111_about_character_ms` VALUES ('anusha','Anusha (Kaameesha Ravindran)','Boys, boys, boys…!!','','2015-05-26 19:19:31',NULL,NULL),('bella','Bella (Chacha Maembong)','Awak dah dengar pasal…?','','2015-05-26 19:19:31',NULL,NULL),('cik-soo','Cik Soo (Carmen Soo)','Awak nak cuba?','','2015-05-26 19:19:31',NULL,NULL),('cikgu-ayu','Cikgu Ayu (Tiz Zaqyah)','OH!! Itulah apa yang saya maksudkan.','Sewaktu cuti sekolah, Zizang (peminat setia Ayu dari Terengganu) cuba melamar Ayu dengan penuh gah sekali sambil disaksikan oleh penduduk kampung - malangnya Ayu terpaksa menolak. Aduh.','2015-05-26 19:19:31',NULL,NULL),('cikgu-bedah','Cikgu Bedah (Sherry Al Hadad)','Squeeze me!','','2015-05-26 19:19:31',NULL,NULL),('encik-ariff','Encik Ariff (Nazrief Nazri)','Are you okay, Ayu?','','2015-05-26 19:19:31',NULL,NULL),('henry-middleton','Henry Middleton (Zain Saidin)','A problem shared is a problem halved.','Henry dah lama bercita-cita untuk menjadi juruacara bagi sebuah rancangan makanan tempatan. Jenuh dia merantau ke segenap pelusuk Malaysia untuk mencuba pelbagai lauk-pauk tradisional - namun akhirnya ditolak kerana saiznya yang terlalu besar. Kasihan Henry.','2015-05-26 19:19:31',NULL,NULL),('jibam','Jibam (Akhmal Nazri)','SAKIT PERUT!','','2015-05-26 19:19:31',NULL,NULL),('jojie','Jojie (Nadiya Nisaa)','Tepi sikit!','Jojie mengisi masa cuti dengan merakam video YouTube tentang fesyen-fesyen tudung yang berbeza. Siapa lagi yang telah menjadi penasihat Jojie kalau bukan Mazlee. Adakah video ini akan berjaya diterbitkan? Tunggu sahajalah ya!','2015-05-26 19:19:31',NULL,NULL),('mazlee','Mazlee (Zhafir Muzani)','Oh My Gucci!','','2015-05-26 19:19:31',NULL,NULL),('puan-aida','Puan Aida (Ogy Ahmad Daud)','Para pelajar haruslah jujur dan menghormati orang lain','','2015-05-26 19:19:31',NULL,NULL),('qila','Qila (Syamiem Alnisa)','Can you help me fill up this survey form?','','2015-05-26 19:19:31',NULL,NULL),('sarjan-bin-mejar','Sarjan bin Mejar (Rahim R2)','OIT! *whistle*','','2015-05-26 19:19:31',NULL,NULL),('sayur','Sayur (Azzam Sham)','Sedapnya sayur ini!','','2015-05-26 19:19:31',NULL,NULL),('see-yew-soon','See Yew Soon (Roax Tan)','Mesti boleh dapat!','See Yew Soon mula bekerja di sebuah medan selera di Singapura, namun begitu dia ditangkap oleh pegawai kastam yang menghantarnya balik ke Malaysia. Tak kisahlah apa pun yang berlaku - asalkan SYS sudah selamat pulang!\n','2015-05-26 19:19:31',NULL,NULL),('taylor-marie-smith','Taylor Marie Smith (Juliana Evans)','I love Malaysia so much!','Ke manalah Putri menghilang agaknya? Rupa-rupanya, Putri pun turut sama terlibat dengan program pertukaran pelajar. Dia kini tinggal bersama keluarga Taylor di USA!','2015-05-26 19:19:31',NULL,NULL),('zack','Zack (Juzzthin)','PEACE!','Zack kini sedang menghasilkan karya terbaharu untuk dipersembahkan kepada syarikat rakaman. Tajuk lagu? \"Zack Ada Kelas\" - mengancam ke tidak?','2015-05-26 19:19:31',NULL,NULL),('zeeq','Zeeq (Afeeq Emir)','But I don\'t want…','','2015-05-26 19:19:31',NULL,NULL);
