INSERT INTO `t0132_exercise` VALUES (1,1,1,'[{\"correct\":\"bully\",\"wrong\":\"lulby\",\"clue\":\"Somebody who treats others badly\"},{\"correct\":\"punished\",\"wrong\":\"udpeishn\",\"clue\":\"Another word for beaten\"},{\"correct\":\"secret\",\"wrong\":\"ctseer\",\"clue\":\"Something you shouldn’t tell people\"}]',1,'2015-05-24 16:48:55','2015-06-05 21:25:06',NULL),(2,1,2,'[{\"correct\":\"I won’t tell if you won’t.\",\"wrong\":\"You no say, I no say.\"},{\"correct\":\"Please don’t tell on me!\",\"wrong\":\"You no tell, I no tell.\"},{\"correct\":\"Can you keep a secret?\",\"wrong\":\"You don’t tell my secret to anyone, can?\"}]',1,'2015-05-24 16:48:55',NULL,NULL),(4,2,4,'[[\"What happened to you?\",\"Just a minor accident.\",\"How did it happen?\",\"I got distracted by a cockroach and crashed.\",\"Oh no! That sounds terrible. I hope you’re not hurt!\"]]',1,'2015-05-24 16:48:55',NULL,NULL),(8,3,2,'[{\"correct\":\"I’ll have to close down my business!\",\"wrong\":\"I can close shop like this!\"},{\"correct\":\"I’m sure you want one.\",\"wrong\":\"You sure want one!\"},{\"correct\":\"It’s as simple as that.\",\"wrong\":\"Simply only.\"}]',1,'2015-05-30 11:24:48',NULL,NULL),(9,3,3,'[[{\"question\":\"to perform responsibly\",\"answer\":\"dutifully\"},{\"question\":\"to crumple something\",\"answer\":\"crush\"},{\"question\":\"observe something with attention\",\"answer\":\"looking closely\"},{\"question\":\"respective\",\"answer\":\"particular\"},{\"question\":\"to vote for something or someone\",\"answer\":\"choose\"}]]',1,'2015-05-30 11:27:01','2015-06-09 16:05:10',NULL),(10,3,5,'[\"He will be the coolest prefect ever!\",\"Why did you turn off my music?\",\"We just came to have a look.\"]',1,'2015-05-30 11:27:52',NULL,NULL),(11,2,1,'[{\"correct\":\"Garbage\",\"wrong\":\"B A G A G E R\",\"clue\":\"Another word for ‘rubbish’.\"},{\"correct\":\"Cockroach\",\"wrong\":\"H O O C A R C C K\",\"clue\":\"The type of insect which made Mr Middleton\"},{\"correct\":\"Confused\",\"wrong\":\"N O F E D U S C\",\"clue\":\"How you feel when you don’t understand something.\"}]',1,'2015-06-09 15:36:26','2015-06-09 15:36:26',NULL),(12,2,6,'[{\"correct\":\"You didn’t say [anything] to the bullies, did you?\",\"wrong\":\"You didn’t say [nothing] to the bullies, did you?\"}]',1,'2015-06-09 15:38:13','2015-06-09 15:50:22',NULL),(13,1,6,'[{\"correct\":\"They can go to the toilet [during] recess.\",\"wrong\":\"They can go to the toilet [on] recess.\"}]',1,'2015-06-09 15:58:38','2015-06-09 15:58:46',NULL);
