INSERT INTO `t0133_video_trailer_en` VALUES (1,1,'1243854','episode-1-strange-beginnings','SUNDAY • 7 JUNE • 6:30PM','Ep 1: Strange Beginnings | Trailer | Oh My English! Class of 2015 | Astro','Watch a sneak peak trailer of Oh My English! Class of 2015 Episode 1: Strange Beginnings - Astro','EPISODE 1: STRANGE BEGINNINGS','It\'s back to school for 4 Merah - only now they\'re Form 5! Jibam gets involved with the bullies in school, forcing him to join the dark side. SYS witnesses Jibam\'s bad deeds and their friendship is tested. Meanwhile, Mr. Middleton returns with a BIG weight problem. He also faces a new threat, Encik Ariff, a charming male teacher who sweeps every woman off her feet, including Cikgu Ayu.','Oh My English! Class of 2015 - Episode 1 Sneak Peek','The new season is back! Catch Mr. Middleton\'s BIG transformation and a whole lot more excitement on Oh My English!',1,'2015-06-01 18:46:48',NULL,NULL),(2,2,'1266641','episode-2-bromance','SUNDAY • 14 JUNE • 6:30PM','Ep 2: Bromance | Trailer | Oh My English! Class of 2015 | Astro','Watch a sneak peak trailer of Oh My English! Class of 2015 Episode 2: Bromance - Astro','EPISODE 2: BROMANCE','Mr. Middleton has an accident because of something Jibam did. SYS questions Jibam about his bad behaviour and asks him to confess. Their friendship is further tested during the investigation involving the bullies and the cause of Mr. Middleton\'s mishap. Will this be the end of their friendship?','Oh My English! Class of 2015 - Episode 2 Sneak Peek','Jibam gets into trouble, leaving SYS concerned with his behaviour. Will this be the end of their friendship?',1,'2015-06-01 18:47:08',NULL,NULL),(3,3,'1266652','episode-3-election-day','SUNDAY • 21 JUNE • 6:30PM','Ep 3: Election Day | Trailer | Oh My English! Class of 2015 | Astro','Watch a sneak peak trailer of Oh My English! Class of 2015 Episode 3: Election Day - Astro','EPISODE 3: ELECTION DAY','Elections are happening at SMK Ayer Dalam to appoint new junior prefects from Form 3 students. Seeing an opportunity for their own selfish gains, Zack and SYS decide to campaign for Sayur and Qila. The Senior students come up with mischievous plans to win votes, and the Juniors are sucked into their dirty game. Meanwhile, a hot new exchange student from USA, Taylor Marie Smith, adds colour to SMK Ayer Dalam, replacing Putri who is away on the same programme.','Oh My English! Class of 2015 - Episode 3 Sneak Peek','It\'s time to elect junior prefects! The Seniors come up with a mischevious plan to win votes and the Juniors fall for their dirty game.',1,'2015-06-01 18:47:08',NULL,NULL),(4,4,'1271478','episode-4-liar-liar-school-on-fire','SUNDAY • 28 JUNE • 6:30PM','Ep 4: Liar, Liar, School on Fire! | Trailer | Oh My English! Class of 2015 | Astro','Watch a sneak peak trailer of Oh My English! Class of 2015 Episode 4: Liar, Liar, School on Fire! - Astro','EPISODE 4: LIAR, LIAR, SCHOOL ON FIRE!','A firefighter gives a talk on fire safety and conducts a fire drill. Unfortunately an actual fire breaks out in 5 Merah, caused by one of the modified electrical extensions that Jibam and SYS brought to school. Jibam and SYS\'s friendship undergoes the final test when Encik Ariff interrogates them about their involvement in the incident.','Oh My English! Class of 2015 - Episode 4 Sneak Peek','Things are about to get heated up in SMK Ayer Dalam.',1,'2015-06-01 18:47:08',NULL,NULL),(5,5,'1243854','episode-5-zero-to-hero','SUNDAY • 5 JULY • 6:30PM','Ep 5: Zero to Hero | Trailer | Oh My English! Class of 2015 | Astro','Watch a sneak peak trailer of Oh My English! Class of 2015 Episode 5: Zero to Hero - Astro','EPISODE 5: ZERO TO HERO','Mr. Middleton feels that his weight issue is a hindrance and causes many problems, like not being able to save Ayu from the fire. Henry decides to get help from Zack\'s uncle, Johan, a famous fitness guru. However, Henry\'s plan to get back his physique backfires after he decides to take a shortcut and realises his mistake. After Henry transforms, he becomes an \'Abang Sado\'.','Oh My English! Class of 2015 - Episode 5 Sneak Peek','Mr. Middleton realises his weight issue and decides to get back his physique.',0,'2015-06-01 18:47:08',NULL,NULL),(6,6,'1243854','episode-6-the-sisterhood-of-ayer-dalam','SUNDAY • 12 JULY • 6:30PM','Ep 6: The Sisterhood of Ayer Dalam | Trailer | Oh My English! Class of 2015 | Astro','Watch a sneak peak trailer of Oh My English! Class of 2015 Episode 6: The Sisterhood of Ayer Dalam - Astro','EPISODE 6: THE SISTERHOOD OF AYER DALAM','Taylor Marie Smith agrees to help her undergrad friend, Saleha, in her final year project. But her good intentions have caused problems that could compromise Saleha’s project. Taylor realises her mistake and tries hard to find a solution to the problem she has caused.','Oh My English! Class of 2015 - Episode 6 Sneak Peek','A friend in need is a friend indeed, but will Taylor\'s help only cause more trouble?',0,'2015-06-01 18:47:25',NULL,NULL),(7,7,'1243854','episode-7-pay-it-forward','SUNDAY • 19 JULY • 6:30PM','Ep 7: Pay It Forward | Trailer | Oh My English! Class of 2015 | Astro','Watch a sneak peak trailer of Oh My English! Class of 2015 Episode 7: Pay It Forward - Astro','EPISODE 7: PAY IT FORWARD','A little girl, Qistina, introduces the concept of \'paying it forward\' to SMK Ayer Dalam: Do good and good will come to you. Everyone believes in the idea except for Jojie, who is adamant that doing good deeds amounts to nothing. She shares her experiences of facing problems after helping others, but is unaware that her incident had actually set off a chain reaction of good deeds.','Oh My English! Class of 2015 - Episode 7 Sneak Peek','Jojie realises that her negativity towards the \'pay it forward\' concept might be something she has been doing all along.',0,'2015-06-01 18:47:25',NULL,NULL),(8,8,'1243854','episode-8-zack-and-taylor-versus-the-world','SUNDAY • 26 JULY • 6:30PM','Ep 8: Zack and Taylor Versus The World | Trailer | Oh My English! Class of 2015 | Astro','Watch a sneak peak trailer of Oh My English! Class of 2015 Episode 8: Zack and Taylor Versus The World - Astro','EPISODE 8: ZACK AND TAYLOR VERSUS THE WORLD\n','The students are transported into a game world where Zack and Taylor have to save Mazlee and themselves from the villain, Henry the Vampire King and his minions. They need to achieve this before Henry drains all their English proficiency away. To achieve their mission, the students must figure out a way to work together and answer multiple English quiz questions while faced with challenges.','Oh My English! Class of 2015 - Episode 8 Sneak Peek','Enter a new world with Zack and Taylor as they save Mazlee from the villian, Henry the Vampire King.',0,'2015-06-01 18:47:25',NULL,NULL),(9,9,'1243854','episode-9-henry-version-2-0','SUNDAY • 2 AUGUST • 6:30PM','Ep 9: Henry Version 2.0 | Trailer | Oh My English! Class of 2015 | Astro','Watch a sneak peak trailer of Oh My English! Class of 2015 Episode 9: Henry Version 2.0 - Astro','EPISODE 9: HENRY VERSION 2.0\n','Mr. Middleton is now all buffed up and physically fit. He however has become vain and overtly obsessive about his new healthy diet and fitness regime. He even starts criticising other people’s eating habits, including Cikgu Ayu’s. Cikgu Ayu takes to sharing her worries about Mr. Middleton with Encik Ariff and they become closer. Mr. Middleton notices this and realises that he needs to act quick to win her back. He apologises to Cikgu Ayu and confesses his feelings towards her.','Oh My English! Class of 2015 - Episode 9 Sneak Peek','Now that Mr. Middleton\'s fit, he becomes vain. Cikgu Ayu shares her worries about him with Encik Ariff and they get closer.',0,'2015-06-01 18:47:25',NULL,NULL),(10,10,'1243854','episode-10-henry-s-last-chance','SUNDAY • 9 AUGUST • 6:30PM','Ep 10: Henry\'s Last Chance | Trailer | Oh My English! Class of 2015 | Astro','Watch a sneak peak trailer of Oh My English! Class of 2015 Episode 10: Henry\'s Last Chance - Astro','EPISODE 10: HENRY\'S LAST CHANCE\n','Cikgu Ayu rejects Mr. Middleton’s confession saying that she does not like the new him. The kids see this and decide to help Mr. Middleton by setting up a karaoke session, without knowing that Mr. Middleton sings horribly. Encik Ariff takes over and finishes the song with Cikgu Ayu, winning her heart in the process. Encik Ariff and Cikgu Ayu learn that they have more things in common, leaving Mr. Middleton heartbroken. He soon realises that Ayu’s happiness is more important than his own and volunteers himself to be transferred to another school.','Oh My English! Class of 2015 - Episode 10 Sneak Peek','The kids help Mr. Middleton win Cikgu Ayu\'s heart back by setting up a karaoke session.',0,'2015-06-01 18:47:25',NULL,NULL),(11,11,'1243854','episode-11','','','','','','','',0,'2015-06-01 18:47:37',NULL,NULL),(12,12,'1243854','episode-12','','','','','','','',0,'2015-06-01 18:47:37',NULL,NULL),(13,13,'1243854','episode-13','','','','','','','',0,'2015-06-01 18:47:37',NULL,NULL),(14,14,'1243854','episode-14','','','','','','','',0,'2015-06-01 18:47:37',NULL,NULL),(15,15,'1243854','episode-15','','','','','','','',0,'2015-06-01 18:47:37',NULL,NULL),(16,16,'1243854','episode-16','','','','','','','',0,'2015-06-01 18:47:50',NULL,NULL),(17,17,'1243854','episode-17','','','','','','','',0,'2015-06-01 18:47:50',NULL,NULL),(18,18,'1243854','episode-18','','','','','','','',0,'2015-06-01 18:47:50',NULL,NULL),(19,19,'1243854','episode-19','','','','','','','',0,'2015-06-01 18:47:50',NULL,NULL),(20,20,'1243854','episode-20','','','','','','','',0,'2015-06-01 18:47:50',NULL,NULL);
