INSERT INTO `t0133_video_trailer_ms` VALUES (1,1,'1243854','episod-1-strange-beginnings','AHAD • 7 JUN • 6:30PTG','Ep 1: Strange Beginnings | Treler | Oh My English! Class of 2015 | Astro','Tonton sedutan treler Oh My English! Class of 2015 Episod 1: Strange Beginnings - Astro','EPISOD 1: STRANGE BEGINNINGS','4 Merah kembali ke sekolah - kini sebagai 5 Merah! Jibam mula bergaul dengan budak-budak kaki buli dan mula terpengaruh dengan mereka. Persahabatannya dengan SYS mula teruji. Pada masa yang sama, Mr. Middleton pulang ke sekolah dengan masalah BESAR. Dia juga kini menghadapi satu ancaman baru iaitu Encik Ariff, seorang guru baru yang memikat hati semua gadis di SMK Ayer Dalam, termasuklah Cikgu Ayu.','Oh My English! Class of 2015 - Sekilas Pandang Episod 1','Musim baru kini kembali! Saksikan perubahan BESAR Mr. Middleton dan pelbagai kejutan hebat dalam Oh My English!',1,'2015-06-01 18:46:48',NULL,NULL),(2,2,'1266641','episod-2-bromance','AHAD • 14 JUN • 6:30PTG','Ep 2: Bromance | Treler | Oh My English! Class of 2015 | Astro','Tonton sedutan treler Oh My English! Class of 2015 Episod 2: Bromance - Astro','EPISOD 2: BROMANCE','Mr. Middleton mengalami kemalangan kecil angkara Jibam. SYS kemudiannya bersemuka dengan Jibam dan menyuruh Jibam mengaku akan kesalahannya. Dalam membongkar punca sebenar kejadian yang menimpa Mr. Middleton tersebut, persahabatan SYS dan Jibam semakin teruji. Dapatkan hubungan mereka diselamatkan?','Oh My English! Class of 2015 - Sekilas Pandang Episod 2','SYS risau akan sikap Jibam yang kini suka cari masalah. Adakah persahabatan mereka akan berkahir?',1,'2015-06-01 18:47:08',NULL,NULL),(3,3,'1266652','episod-3-election-day','AHAD • 21 JUN • 6:30PTG','Ep 3: Election Day | Treler | Oh My English! Class of 2015 | Astro','Tonton sedutan treler Oh My English! Class of 2015 Episod 3: Election Day - Astro','EPISOD 3: ELECTION DAY','Pilihan raya pengawas-pengawas baru di kalangan Tingkatan 3 sedang dijalankan di SMK Ayer Dalam. Zack dan SYS yang ingin mengambil kesempatan ini untuk kebaikan mereka sendiri mula berkempen untuk Sayur dan Qila. Pelajar-pelajar senior merancang pelbagai taktik kotor untuk memenangi undi, dan pelajar-pelajar junior terperangkap dalam helah mereka. Sementara itu, Taylor Marie Smith, seorang pelajar pertukaran yang cantik menawan dari USA kini hadir di SMK Ayer Dalam bagi menggantikan Putri yang juga dalam program yang sama.','Oh My English! Class of 2015 - Sekilas Pandang Episod 3','Masa untuk melantik pengawas baru! Macam-macam muslihat diaturkan oleh para senior agar pelajar pilihan mereka menang.',1,'2015-06-01 18:47:08',NULL,NULL),(4,4,'1271478','episod-4-liar-liar-school-on-fire','AHAD • 28 JUN • 6:30PTG','Ep 4: Liar, Liar, School on Fire! | Treler | Oh My English! Class of 2015 | Astro','Tonton sedutan treler Oh My English! Class of 2015 Episod 4: Liar, Liar, School on Fire! - Astro','EPISOD 4: LIAR, LIAR, SCHOOL ON FIRE!','Seorang ahli bomba sedang menjalankan latihan kebakaran di sekolah. Tidak semena-mena, kebakaran kecil benar-benar merebak di kelas 5 Merah yang disebabkan oleh plag penyambung yang diubahsuai oleh Jibam dan SYS. Persahabatan mereka diuji buat kali terakhir apabila mereka disoal siasat oleh Encik Ariff tentang peristiwa yang berlaku.','Oh My English! Class of 2015 - Sekilas Pandang Episod 4','Makin lama makin hangat suasana ni SMK Ayer Dalam.',1,'2015-06-01 18:47:08',NULL,NULL),(5,5,'1243854','episod-5-zero-to-hero','AHAD • 5 JULAI • 6:30PTG','Ep 5: Zero to Hero | Treler | Oh My English! Class of 2015 | Astro','Tonton sedutan treler Oh My English! Class of 2015 Episod 5: Zero to Hero - Astro','EPISOD 5: ZERO TO HERO','Mr. Middleton merasakan berat badannya adalah punca segala masalah, contohnya sewaktu dia gagal menyelamatkan Ayu daripada kebakaran. Henry pergi mendapatkan pertolongan daripada bapa saudara Zack iaitu Johan, seorang pelatih peribadi yang terkenal. Namun rancangannya memakan diri apabila Henry cuba mengambil jalan singkat. Setelah perubahan yang dia alami, Henry menjadi \'Abang Sado\'.','Oh My English! Class of 2015 - Sekilas Pandang Episod 5','Mr. Middleton sedar akan masalah besar yang dihadapinya dan ingin kembali sihat.',0,'2015-06-01 18:47:08',NULL,NULL),(6,6,'1243854','episod-6-the-sisterhood-of-ayer-dalam','AHAD • 12 JULAI • 6:30PTG','Ep 6: The Sisterhood of Ayer Dalam | Treler | Oh My English! Class of 2015 | Astro','Tonton sedutan treler Oh My English! Class of 2015 Episod 6: The Sisterhood of Ayer Dalam - Astro','EPISOD 6: THE SISTERHOOD OF AYER DALAM','Taylor Marie Smith bersetuju untuk membantu rakannya Saleha dalam menyiapkan projek tahun akhir. Namun niat baiknya mendatangkan masalah yang mungkin akan memberi kesan buruk terhadap projek tersebut. Taylor sedar akan kesilapannya dan cuba dengan sedaya upaya untuk mencari jalan penyelesaian.','Oh My English! Class of 2015 - Sekilas Pandang Episod 6','Nak tolong pun kenalah kena dengan tempat, adakah niat baik Taylor hanya akan mendatangkan masalah?',0,'2015-06-01 18:47:25',NULL,NULL),(7,7,'1243854','episod-7-pay-it-forward ','AHAD • 19 JULAI • 6:30PTG','Ep 7: Pay It Forward | Treler | Oh My English! Class of 2015 | Astro','Tonton sedutan treler Oh My English! Class of 2015 Episod 7: Pay It Forward - Astro','EPISOD 7: PAY IT FORWARD','Seorang gadis kecil, Qistina, memperkenalkan konsept \'buat baik dibalas baik\' di SMK Ayer Dalam. Semua orang bersetuju dengan idea tersebut kecuali Jojie yang berpendapat ianya tidak mendatangkan sebarang kebaikan kepada diri sendiri. Jojie menceritakan tentang masalah yang dia hadapi ketika cuba menolong seseorang, namun tanpa dia sedari, kejadian tersebut sebenarnya telah memulakan rantaian perkara-perkara baik yang dilakukan oleh semua orang yang terlibat.','Oh My English! Class of 2015 - Sekilas Pandang Episod 7','Walaupun Jojie tidak setuju dengan konsep buat baik dibalas baik, dia sendiri yang telah berkelakuan sedemikian selama ini.',0,'2015-06-01 18:47:25',NULL,NULL),(8,8,'1243854','episod-8-zack-and-taylor-versus-the-world','AHAD • 26 JULAI • 6:30PTG','Ep 8: Zack and Taylor Versus The World | Treler | Oh My English! Class of 2015 | Astro','Tonton sedutan treler Oh My English! Class of 2015 Episod 8: Zack and Taylor Versus The World - Astro','EPISOD 8: ZACK AND TAYLOR VERSUS THE WORLD\n','Para pelajar tiba-tiba dipindahkan ke sebuah dunia permainan di mana Zack dan Taylor perlu menyelamatkan Mazlee dan diri mereka sendiri daripada raja pontianak Henry dan konco-konconya. Ianya perlulah dilakukan sebelum Henry menyedut kesemua kemahiran Bahasa Inggeris mereka. Untuk mencapai misi ini, para pelajar perlu mencari jalan untuk bekerja sama dan menjawab kuiz Bahasa Inggeris sambil menempuhi pelbagai cabaran.','Oh My English! Class of 2015 - Sekilas Pandang Episod 8','Selami dunia yang berbeza bersama Zack dan Taylor yang cuba menyelamatkan Mazlee daripada penjahat utama, Henry the Vampire King.',0,'2015-06-01 18:47:25',NULL,NULL),(9,9,'1243854','episod-9-henry-version-2-0','AHAD • 2 OGOS • 6:30PTG','Ep 9: Henry Version 2.0 | Treler | Oh My English! Class of 2015 | Astro','Tonton sedutan treler Oh My English! Class of 2015 Episod 9: Henry Version 2.0 - Astro','EPISOD 9: HENRY VERSION 2.0 \n\n','Mr. Middleton kini sudah penuh sihat dan berbadan sasa. Malangnya dia juga penuh riak dan sangat taksub dengan diet dan latihan fizikalnya. Malah Henry mula mengkritik tabiat makan orang lain, termasuklah Cikgu Ayu. Cikgu Ayu mula mengadu akan masalah ini kepada Encik Ariff, dan mereka berdua semakin lama semakin rapat. Mr. Middleton perasan akan perkara ini dan sedar yang dia perlu berbuat sesuatu dengan segera. Dia lantas meminta maaf dan meluahkan perasaannya kepada Cikgu Ayu. ','Oh My English! Class of 2015 - Sekilas Pandang Episod 9','Makin sasa, makin riak perangai Mr. Middleton. Cikgu Ayu meluahkan rasa bimbangnya kepada Cikgu Arrif dan hubungan mereka semakin rapat.',0,'2015-06-01 18:47:25',NULL,NULL),(10,10,'1243854','episod-10-henry-s-last-chance','AHAD • 9 OGOS • 6:30PTG','Ep 10: Henry\'s Last Chance | Treler | Oh My English! Class of 2015 | Astro','Tonton sedutan treler Oh My English! Class of 2015 Episod 10: Henry\'s Last Chance - Astro','EPISOD 10: HENRY\'S LAST CHANCE\n','Cikgu Ayu menolak pengakuan Mr. Middleton kerana tidak suka akan imej barunya. Para pelajar terlihat akan peristiwa ini dan cuba membantu Mr. Middleton dengan merancang sesi karaoke tanpa mengetahui yang Mr. Middleton sebenarnya bersuara sumbang. Encik Arrif kemudiannya mengambil alih mikrofon serta menyudahkan lagu tersebut bersama Cikgu Ayu, sekaligus memenangi hatinya. Encik Arrif dan Cikgu Ayu menyedari yang mereka banyak persamaan, tinggallah Mr. Middleton patah hati seorang diri. Henry kemudiannya menyedari yang kebahagiaan Ayu lebih penting daripada dirinya sendiri, dan menawarkan dirinya untuk berpindah sekolah.','Oh My English! Class of 2015 - Sekilas Pandang Episod 10','Para pelajar cuba membantu Mr. Middle memenangi hati Cikgu Ayu dengan mengadakan sesi karaoke.',0,'2015-06-01 18:47:25',NULL,NULL),(11,11,'1243854','','','','','','','','',0,'2015-06-01 18:47:37',NULL,NULL),(12,12,'1243854','','','','','','','','',0,'2015-06-01 18:47:37',NULL,NULL),(13,13,'1243854','','','','','','','','',0,'2015-06-01 18:47:37',NULL,NULL),(14,14,'1243854','','','','','','','','',0,'2015-06-01 18:47:37',NULL,NULL),(15,15,'1243854','','','','','','','','',0,'2015-06-01 18:47:37',NULL,NULL),(16,16,'1243854','','','','','','','','',0,'2015-06-01 18:47:50',NULL,NULL),(17,17,'1243854','','','','','','','','',0,'2015-06-01 18:47:50',NULL,NULL),(18,18,'1243854','','','','','','','','',0,'2015-06-01 18:47:50',NULL,NULL),(19,19,'1243854','','','','','','','','',0,'2015-06-01 18:47:50',NULL,NULL),(20,20,'1243854','','','','','','','','',0,'2015-06-01 18:47:50',NULL,NULL);
