INSERT INTO `t0135_ask_henry` VALUES (25,'170252634','shinyin92','608878459163533313','Tttteeessssstttttiiiinnngg. #ohmyenglish','Vocabulary \n\nMy mother accompanied me to school on the first day. Other parents accompanied their children as well. We all waited in front of the school office.\nSoon a teacher came and led us to some classrooms. There we were put into four separate classes. This was when some children began to cry as the parents were not allowed into the classrooms. I did not cry because I had been to kindergarten before. Actually my mother went home soon after for she knew I would be all right.\n\nIt was an enjoyable time for me as I got to know my new classmates. The teacher was very busy writing down our particulars so we had plenty of time to ourselves.\n\nMeantime some children continued to sob while their parents looked in anxiously through the windows.\n\nSoon recess came. Some of us headed for the tuck-shop while the rest headed for their parents. I bought a drink with the money my mother gave me. Getting to know my new friends had made me thirsty.','2015-06-10 22:32:22','vocabulary',0,1,'approved',1,'2015-06-11 06:08:47','2015-06-11 06:32:22',NULL),(26,'201608329','melissaszehwa','608884665307418624','testing melissa asking question #ohmyenglish','IDIOMS\n\nAfter recess we went back to out classroom and my new friends and I managed to coax two boys to stop crying. In fact, soon we were laughing and playing together. Once in a while the teacher had to tell us to keep quiet as we were making too much noise.\n\nStill some parents looked in anxiously through the windows.\n\nFinally the bell rang for us to go home. Some of us were very relieved to be reunited with our parents. I too was glad to see my mother waiting for me at the school gate. I had made many friends. It had been a wonderful first day at school.','2015-06-10 22:34:13','idioms',0,1,'approved',1,'2015-06-11 06:33:26','2015-06-11 06:34:13',NULL),(27,'14539938','khairul','608891354567966720','Kenapa dunia ni bulat? #ohmyenglish','Advice\n\nFinally the bell rang for us to go home. Some of us were very relieved to be reunited with our parents. I too was glad to see my mother waiting for me at the school gate. I had made many friends. It had been a wonde','2015-06-10 23:03:41','advice',0,1,'approved',1,'2015-06-11 07:00:01','2015-06-11 07:03:41',NULL),(28,'170252634','shinyin92','608894707981164544','Hooray I can submit question now. What should I ask? #vocabulary #ask12345','Others\n\nA Home\nAn inspiringly crazy open-plan office with toys, creature comforts and artisanal coffee. Perks aplenty, including the use of the company driver for personal chores','2015-06-10 23:23:59','others',0,1,'approved',1,'2015-06-11 07:13:21','2015-06-11 07:23:59',NULL),(29,'170252634','shinyin92','608895208797831168','Testing to see my question appear anot. #ask12345','Vocabulary\n\nA Family\nA family of 90  awesome people to work with, learn from, and play with.','2015-06-10 23:24:21','vocabulary',0,1,'approved',1,'2015-06-11 07:15:20','2015-06-11 07:24:21',NULL),(30,'3241212685','omeseason4','608897213905764352','A Purpose #ask12345','Others\n\nAmazing Clients\nThe opportunity to work with, learn from, and play with (okay, not all of them want to play) a diverse range of clients: from coo','2015-06-10 23:24:45','others',0,1,'approved',1,'2015-06-11 07:23:18','2015-06-11 07:24:45',NULL);
