INSERT INTO `t0136_article` VALUES (33,'3 New Words You Won\'t Believe Are In The English Dictionary!','3-new-words-you-wont-believe-are-in-the-english-dictionary','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>&ldquo;That&rsquo;s not a word.&rdquo; Have you ever heard someone say that? New words are being created all the time, and sometimes it&rsquo;s difficult to keep up with what is in the dictionary and what isn&rsquo;t. The Oxford English Dictionary (OED) adds dozens of new words every year. Here are some of the best ones from the last 12 months:</p>\r\n<h2 style=\"color: #11435e;\">laters</h2>\r\n<p>Do you say &lsquo;bye&rsquo; or &lsquo;see you later&rsquo; when you hang up the phone? That&rsquo;s so 20th century! According to the OED, people now say &lsquo;laters&rsquo;.</p>\r\n<p><img src=\"http://31.media.tumblr.com/4b7aea8ceddadd859ce7b976b9b7104f/tumblr_moa5zhudZu1rzapx4o1_400.gif\" alt=\"\" /><br /><span class=\"caption\">(Source: <a href=\"http://memegifs.tumblr.com/\">Memegifs</a>)</span></p>\r\n<h2 style=\"color: #11435e;\">Skype</h2>\r\n<p>We all know what Skype is, but it&rsquo;s just been added to the dictionary as a verb. That means you can now &lsquo;Skype&rsquo; your friends, just like you can &lsquo;Google&rsquo; something on the internet, or &lsquo;Photoshop&rsquo; a picture!</p>\r\n<p><img src=\"http://media.giphy.com/media/fpcbhdPjvk3bq/giphy.gif\" alt=\"\" /><br /><span class=\"caption\">(Source: <a href=\"http://giphy.com/gifs/workaholics-skype-facetime-fpcbhdPjvk3bq\">Giphy</a>)</span></p>\r\n<h2 style=\"color: #11435e;\">selfie</h2>\r\n<p>There&rsquo;s a song about selfies, so it must be a word, and the OED added it last year. &lsquo;Selfie stick&rsquo; isn&rsquo;t in the dictionary yet, but it can&rsquo;t be long before that gets added too!</p>\r\n<p><img src=\"http://media.giphy.com/media/OnDgnX2DiWJVe/giphy.gif\" alt=\"\" /><br /> <span class=\"caption\">(Source:&nbsp;<a href=\"http://giphy.com/gifs/jimmy-fallon-fallontonight-monologue-OnDgnX2DiWJVe\">Giphy</a>)</span></p>\r\n<p>Remember, though, that just because a word isn&rsquo;t in the dictionary, it doesn&rsquo;t mean it&rsquo;s not a word. If enough people use it, it will be added later. So try making up some new words yourself&mdash;maybe one of them will make it into the dictionary one day!</p>\r\n<p>Laters!&nbsp;;-)</p>\r\n</body>\r\n</html>','','The English language is a funny yet wonderful thing. Find out what the 3 words are!','Bahasa Inggeris adalah bahasa yang lucu dan juga indah. Ketahui apa maknanya 3 perkataan ini!','2015-07-10','3 New Words You Won\'t Believe Are In The English Dictionary!','“That’s not a word.” Have you ever heard someone say that? New words are being created all the time, and sometimes it’s difficult to keep up with what is...',0,1,'2015-06-30 13:41:44','2015-07-05 15:15:37',NULL),(34,'Are You A Polyglot? (No It\'s Not a Pokemon!) ','are-you-a-polyglot-no-its-not-a-pokemon','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>How many languages do you speak? In the UK and the USA, most people only speak one: English. But in Malaysia it&rsquo;s not uncommon for people to speak two or three languages. Someone who speaks several languages is called a polyglot. Someone who speaks dozens of languages is a language learning record breaker!</p>\r\n<p><img src=\"https://s-media-cache-ak0.pinimg.com/736x/98/6f/59/986f595daf60f1b9d11acf4beaa3e4a4.jpg\" alt=\"\" /><br /><span class=\"caption\">(Source: <a href=\"https://www.pinterest.com/pin/28077197651469980/\">Pinterest</a>)</span></p>\r\n<p>One of the most amazing record breakers is Ziad Fazah, who now lives in Brazil and says he is able to speak 58 languages! He has appeared on TV shows and chatted to people from different countries to prove his skills, although he couldn&rsquo;t understand everything they said perfectly.</p>\r\n<p><img src=\"http://media.giphy.com/media/NnGGHE0muVqpO/giphy.gif\" alt=\"\" /><br /><span class=\"caption\">(Source: <a href=\"http://giphy.com/gifs/applause-the-rock-amazed-NnGGHE0muVqpO\">Giphy</a>)</span></p>\r\n<p>Another super-polyglot was Kato Lomb, from Hungary, who taught herself 15 languages, and worked as a translator and interpreter. She was so good at some of them that she could listen to someone speaking and interpret what they were saying in a different language &ndash; at the same time!</p>\r\n<p><img src=\"http://media.giphy.com/media/12HFqNl5DrMWoU/giphy.gif\" alt=\"\" /><br /><span class=\"caption\">(Source: <a href=\"http://giphy.com/gifs/kristen-wiig-no-way-12HFqNl5DrMWoU\">Giphy</a>)</span></p>\r\n<p>Polyglots can teach us a lot about how to learn English because many of them teach themselves. Alex Rawlings, an English teacher who speaks 11 languages, says that the best way to learn is from context. So he watches TV, listens to songs, and reads books to learn languages.</p>\r\n<p>Try doing the same thing, and see how many languages you can learn!</p>\r\n<p><img src=\"http://mangolanguages-com-wp-content.s3.amazonaws.com/wp-content/uploads/2013/06/2.jpg\" alt=\"\" /><br /><span class=\"caption\">(Source: <a href=\"http://mangolanguages-com-wp-content.s3.amazonaws.com/wp-content/uploads/2013/06/2.jpg\">Mangolanguages</a>)</span></p>\r\n</body>\r\n</html>','','Sounds fancy, doesn\'t it? If you are able to speak multiple languages, you can possibly be a polyglot!','Bunyi macam canggih je kan? Kalau anda boleh bercakap dalam pelbagai bahasa, anda mungkin seorang \'polyglot\'!','2015-07-10','Are You A Polyglot? (No It\'s Not a Pokemon!)','How many languages do you speak? In the UK and the USA, most people only speak one: English. But in Malaysia it’s not uncommon for people to speak two or...',0,1,'2015-06-30 13:42:15','2015-07-03 18:55:49',NULL),(35,'3 New Words You Won’t Believe Are In The English Dictionary! - test','3-new-words-you-wont-believe-are-in-the-english-dictionary-test','<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>&ldquo;That&rsquo;s not a word.&rdquo; Have you ever heard someone say that? New words are being created all the time, and sometimes it&rsquo;s difficult to keep up with what is in the dictionary and what isn&rsquo;t. The Oxford English Dictionary (OED) adds dozens of new words every year. Here are some of the best ones from the last 12 months:</p>\r\n<h2 style=\"color: #11435e;\"><strong>laters</strong></h2>\r\n<p><strong>Do you say &lsquo;bye&rsquo; or &lsquo;see you later&rsquo; when you hang up the phone? That&rsquo;s so 20<sup>th</sup> century! According to the OED, people now say &lsquo;laters&rsquo;.</strong></p>\r\n<h6 style=\"color: #11435e;\"><strong><img src=\"http://31.media.tumblr.com/4b7aea8ceddadd859ce7b976b9b7104f/tumblr_moa5zhudZu1rzapx4o1_400.gif\" alt=\"\" width=\"362\" height=\"161\" /><br /></strong><span class=\"underline\"><span style=\"color: #ffffff;\"><strong>(Source: Memegifs)</strong></span></span></h6>\r\n</body>\r\n</html>','','The English language is a funny yet wonderful thing. Find out what the 3 words are!','Bahasa Inggeris adalah bahasa yang lucu dan juga indah. Ketahui apa maknanya 3 perkataan ini!','2015-07-31','3 New Words You Won’t Believe Are In The English Dictionary!','“That’s not a word.” Have you ever heard someone say that? New words are being created all the time, and sometimes it’s difficult to keep up with what is...',0,1,'2015-07-03 19:16:19','2015-07-05 13:25:05',NULL);
