INSERT INTO `t0139_personality_quiz_question` VALUES (1,'how-malaysian-is-your-english','What would you ask your teacher?','Can I go toilet for a while?','Can I go to toilet?','Can I quickly go to the toilet?','2015-07-01 11:05:43',NULL,NULL),(2,'how-malaysian-is-your-english','Before you go to bed, which one do you do?','Close the lights.','Off the lights.','Turn off the lights.','2015-07-01 11:05:43',NULL,NULL),(3,'how-malaysian-is-your-english','Which sentence sounds correct to you? ','I am having a brother.','I am speaking two languages. ','I am going to the canteen.','2015-07-01 11:05:43',NULL,NULL),(4,'how-malaysian-is-your-english','What would you say? ','We discussing about our homework.','We are discussing about our homework.','We are discussing our homework.','2015-07-01 11:05:43',NULL,NULL),(5,'how-malaysian-is-your-english','You want to get a ride to school with your friend. What do you ask?','I follow you. Can? ','Can I follow you?','Can I get a lift?','2015-07-01 11:05:43',NULL,NULL),(6,'how-malaysian-is-your-english','Which sentence looks best to you? ','I stay in Klang all my life.','I live in Klang all my life.','I have lived in Klang all my life. ','2015-07-01 11:05:43',NULL,NULL),(7,'how-malaysian-is-your-english','Which offer would you use?','I can send you.','I can take you.','I can give you a lift. ','2015-07-01 11:05:43',NULL,NULL),(8,'how-malaysian-is-your-english','How would you describe where he is?','He’s outstation.','He’s not in town.','He’s out of town.','2015-07-01 11:05:43',NULL,NULL),(9,'how-malaysian-is-your-english','Which sentence would you use?','Last week he give a book for me.','Last week he gave a book to me. ','Last week he gave me a book.','2015-07-01 11:05:43',NULL,NULL),(10,'how-malaysian-is-your-english','Do you know which one is correct?    ','He have many childrens.','I want more informations.','I gave him my contact details.','2015-07-01 11:05:43',NULL,NULL),(101,'which-english-words-describes-you','Which do you prefer to do in school?','Study','Talk','Think','2015-07-01 11:05:43',NULL,NULL),(102,'which-english-words-describes-you','How do you fix something that’s broken?','Try','Ask','Plan','2015-07-01 11:05:43',NULL,NULL),(103,'which-english-words-describes-you','Which job describes you best?','Engineer','Teacher','Artist','2015-07-01 11:05:43',NULL,NULL),(104,'which-english-words-describes-you','What’s best about school?','Knowledge','Friends','Opportunities','2015-07-01 11:05:43',NULL,NULL),(105,'which-english-words-describes-you','You see two friends fighting.  What do you do?','Pull them apart','Negotiate peace','Distract them','2015-07-01 11:05:43',NULL,NULL),(106,'which-english-words-describes-you','Which device describes you best?','A laptop','A mobile phone','A tablet','2015-07-01 11:05:43',NULL,NULL),(107,'which-english-words-describes-you','What would you prefer to do during the school holidays?','Get a part-time job','Volunteer for a charity','Set up your own business','2015-07-01 11:05:43',NULL,NULL);
