lling all #jibamnerz ! What\'s going on with SYS & Jibam? Something really shocking is going to happen to them.. Let\'s watch #OhMyEnglish TODAY at 6.30pm on TVIQ 610/Maya HD 135. Trust me, you have to watch it ','https://scontent.cdninstagram.com/hphotos-xaf1/t51.2885-15/e15/11374705_910839892310287_1745831472_n.jpg','https://instagram.com/p/4dgu8syrTA/','2015-06-28 05:29:06','2015-06-30 07:24:49',NULL,NULL),(530,'instagram','1017078986096424451_211454780','photo','WHAT?! Something bigger than fire is about to happen. Find out today on Oh My English! Class of 2015, 6:30PM, via TVIQ & Maya HD 135! #OhMyEnglish #Classof2015 @officialjuzzthin @nadnisaa','https://scontent.cdninstagram.com/hphotos-xaf1/t51.2885-15/e15/11356495_425655420972291_1447744695_n.jpg','https://instagram.com/p/4dY_L6yrYD/','2015-06-28 04:21:25','2015-06-30 07:24:49',NULL,NULL),(531,'instagram','1017078317826356714_211454780','photo','#Repost @roax_tan with @repostapp.\n・・・\nHahahaha, robotic! \n#OhMyEnglish #roax #roaxtan #robot #fun #studio #onset\n@aeshaa7 @juesophevans @officialjuzzthin','https://scontent.cdninstagram.com/hphotos-xaf1/t51.2885-15/e15/11378649_868853279872290_1039682806_n.jpg','https://instagram.com/p/4dY1diyrXq/','2015-06-28 04:20:05','2015-06-30 07:24:49',NULL,NULL),(532,'facebook','227747950638855_874063372673973','text','\'Safety\' means \'the condition of being protected from or unlikely to cause danger, risk, or injury\'. Where do you usually hear this word?','','','2015-06-27 19:19:00','2015-06-30 07:24:49',NULL,NULL),(533,'instagram','1016333638948271854_211454780','photo','Eh, kenapa mereka berdua di bilik guru ni? Kena denda ke? Denda apa agaknya yang akan dikenakan terhadap mereka? @akhmalnazri @roax_tan #OhMyEnglish #Classof2015','https://scontent.cdninstagram.com/hphotos-xaf1/t51.2885-15/e15/11352901_1863389100553417_427995687_n.jpg','https://instagram.com/p/4avg9Syrbu/','2015-06-27 03:40:32','2015-06-30 07:24:49',NULL,NULL),(534,'facebook','227747950638855_874056386008005','text','Help! We heard Cikgu Ayu is trapped in the room. What do you think SYS and Jibam should do? \nA) Try to kick the door open \nB) Get help from others \nC) Continue to panic \nD) Give motivation to Cikgu Ayu','','','2015-06-26 18:50:00','2015-06-30 07:24:49',NULL,NULL),(535,'instagram','1015951601414354478_211454780','photo','Ada seseorang terperangkap dalam kelas! Cuba teka siapa? #OhMyEnglish #Classof2015 @therealzainsaidin @nazrief_nazri','https://scontent.cdninstagram.com/hphotos-xaf1/t51.2885-15/e15/11356893_838778899511266_1376932143_n.jpg','https://instagram.com/p/4ZYplHSrYu/','2015-06-26 15:01:30','2015-06-30 07:24:49',NULL,NULL),(536,'facebook','227747950638855_874047296008914','text','Let\'s learn some words that are associated with a fireman!','','','2015-06-26 06:14:47','2015-06-30 07:24:49',NULL,NULL),(537,'instagram','1015144744697378620_211454780','photo','We all make mistakes, Let’s make amends. Don’t wait too long, lets #kosongkosong. Share your stories at www.kosongkosong.com.my','https://scontent.cdninstagram.com/hphotos-xap1/t51.2885-15/e15/10899216_706374632841648_1017433739_n.jpg','https://instagram.com/p/4WhMRPSrc8/','2015-06-25 12:18:25','2015-06-30 07:24:49',NULL,NULL),(538,'instagram','1015029931396741022_211454780','photo','Anda bakal saksikan satu lagi konflik yang berlaku di antara #Jibam @akhmalnazri & #SYS @roax_tan dalam episod terbaru #OhMyEnglish #Classof2015, Ahad ini, jam 6:30 petang melalui saluran #TVIQ & #MayaHD! Jom tengok kalau nak tahu apa akan jadi!','https://scontent.cdninstagram.com/hphotos-xaf1/t51.2885-15/e15/11326686_1596225010643999_386127881_n.jpg','https://instagram.com/p/4WHFhBSree/','2015-06-25 08:30:18','2015-06-30 07:24:49',NULL,NULL),(539,'facebook','227747950638855_873575952722715','text','We all make mistakes. Let’s make amends. Don’t wait too long, lets #kosongkosong. Share your stories at www.kosongkosong.com.my','','','2015-06-25 03:00:01','2015-06-30 07:24:49',NULL,NULL),(540,'facebook','227747950638855_873554126058231','text','Alamak! Jibam terperangkap dalam kelas! Komen \"Tolong Jibam\" atau \"Help Jibam\" cepat untuk selamatkannya!','','','2015-06-25 00:15:45','2015-06-30 07:24:49',NULL,NULL),(541,'instagram','1014514536923444512_211454780','photo','Can you point out the mistakes? #OhMyEnglish #classof2015','https://scontent.cdninstagram.com/hphotos-xfa1/t51.2885-15/e15/11333417_1604856626460576_69438962_n.jpg','https://instagram.com/p/4UR5igyrUg/','2015-06-24 15:26:18','2015-06-30 07:24:49',NULL,NULL),(542,'instagram','1014486818588636616_211454780','photo','How many of you know how to use a fire extinguisher? Read this to find out! (credit : http://www.barrierefire.com) #OhMyEnglish #Classof2015 #Words #Vocabulary','https://scontent.cdninstagram.com/hphotos-xfa1/t51.2885-15/e15/11376395_1440627746259981_2011070136_n.jpg','https://instagram.com/p/4ULmLzSrXI/','2015-06-24 14:31:14','2015-06-30 07:24:49',NULL,NULL),(543,'facebook','227747950638855_873217346091909','text','Remember both are nouns but have different meanings!','','','2015-06-24 06:20:15','2015-06-30 07:24:49',NULL,NULL),(544,'instagram','1014172649473619024_211454780','photo','Thank you for all the questions tweeted last Sunday! Zack, Zeeq & Jibam had a tremendous time answering them. Stay tuned for more live sessions and be sure to watch the next episode this Sunday, 6:30pm via TVIQ & Maya HD! @officialjuzzthin @akhmalnazri @a','https://scontent.cdninstagram.com/hphotos-xfp1/t51.2885-15/e15/10401645_1058741124153604_1285922567_n.jpg','https://instagram.com/p/4TEKbAyrRQ/','2015-06-24 04:07:02','2015-06-30 07:24:49',NULL,NULL),(545,'facebook','227747950638855_872980176115626','text','Thank you for all the questions tweeted last Sunday! Zack, Zeeq & Jibam had a tremendous time answering them. Stay tuned for more live sessions and be sure to watch the next episode this Sunday, 6:30pm via TVIQ & Maya HD!','','','2015-06-23 20:05:31','2015-06-30 07:24:49',NULL,NULL),(546,'instagram','1013424381982586465_211454780','photo','Oh no! SMK Ayer Dalam is on fire! Who could be the cause of it? Find out this Sunday at 6:30 pm via Astro TVIQ 610 & Maya HD 135! #OhMyEnglish #Classof2015','https://scontent.cdninstagram.com/hphotos-xfa1/t51.2885-15/e15/11335517_824972544266469_2013748881_n.jpg','https://instagram.com/p/4QaBsmyrZh/','2015-06-23 03:20:22','2015-06-30 07:24:49',NULL,NULL),(547,'facebook','227747950638855_872618969485080','text','#sukasangatlayan\n#ohmyenglish\n#terbaikk','','','2015-06-23 00:43:03','2015-06-30 07:24:49',NULL,NULL),(548,'facebook','227747950638855_872540572826253','text','Oh no! SMK Ayer Dalam is on fire! Who could be the cause of it? Find out this Sunday at 6:30 pm via Astro TVIQ 610 & Maya HD 135!','','','2015-06-22 19:03:07','2015-06-30 07:24:49',NULL,NULL),(549,'facebook','227747950638855_872156766197967','text','Kenapa tak masukkan semua episod oh my english ini?','','','2015-06-22 00:49:41','2015-06-30 07:24:49',NULL,NULL),(550,'facebook','227747950638855_872074736206170','text','where can i watch episode 2 ? only can find ep 1 and 3.','','','2015-06-21 23:51:50','2015-06-30 07:24:49',NULL,NULL),(551,'facebook','227747950638855_872050122875298','text','The full 3rd episode of #OhMyEnglish #Classof2015 is now available on our YouTube channel : https://www.youtube.com/watch?v=lhGbXbCmwww. Have fun watching it!','','','2015-06-21 22:20:46','2015-06-30 07:24:49',NULL,NULL),(552,'instagram','1012202409177036409_211454780','photo','Say cheeeeeeese!!! @akhmalnazri @officialjuzzthin @afeeqemir #OhMyEnglish #Classof2015','https://scontent.cdninstagram.com/hphotos-xaf1/t51.2885-15/e15/11335068_372282302974231_862240407_n.jpg','https://instagram.com/p/4MELpvyrZ5/','2015-06-21 10:52:31','2015-06-30 07:24:49',NULL,NULL),(553,'instagram','1012197151507920377_211454780','photo','Look! @officialjuzzthin @akhmalnazri & @afeeqemir are enjoying themselves watching the latest episode of #OhMyEnglish #Classof2015 right now! LIKE if you are watching as well!','https://scontent.cdninstagram.com/hphotos-xfa1/t51.2885-15/e15/11313536_1622930237994074_1205052111_n.jpg','https://instagram.com/p/4MC_JKSrX5/','2015-06-21 10:42:05','2015-06-30 07:24:49',NULL,NULL),(554,'instagram','1012173818645100518_211454780','photo','#Jibamnerz sekalian! Cepat hantar soalan anda kepada #Jibam @akhmalnazri melalui Twitter berserta hashtag #OhMyEnglish untuk berpeluang mendapat jawapan daripada beliau secara LIVE bermula 6 petang hari ini! Cepat tweeeeeeet kawan-kawan!','https://scontent.cdninstagram.com/hphotos-xaf1/t51.2885-15/e15/11357556_1609841305938970_1530815708_n.jpg','https://instagram.com/p/4L9rmvSrfm/','2015-06-21 09:55:43','2015-06-30 07:24:49',NULL,NULL),(555,'instagram','1012163378552682233_211454780','photo','Hey guys! @officialjuzzthin & @afeeqemir are waiting for your questions and they will answer them LIVE starting 6pm today! Tweet your questions along with the #OhMyEnglish hashtag now now now!!!!!','https://scontent.cdninstagram.com/hphotos-xaf1/t51.2885-15/e15/11356455_125037524495593_1534793835_n.jpg','https://instagram.com/p/4L7TrpSrb5/','2015-06-21 09:34:58','2015-06-30 07:24:49',NULL,NULL),(556,'instagram','1012054699010602931_211454780','photo','Zeeq @afeeqemir is warming up for his interview with @teddysphotos at 6:30pm today! Don\'t miss the new episode! #OhMyEnglish #Classof2015','https://scontent.cdninstagram.com/hphotos-xaf1/t51.2885-15/e15/11352138_835796583182684_999462200_n.jpg','https://instagram.com/p/4LimL7yrez/','2015-06-21 05:59:03','2015-06-30 07:24:49',NULL,NULL),(557,'facebook','227747950638855_871548629592114','text','Tak sempat tonton episod ke-3 tadi? Jangan risau, siaran ulangan akan bermula pada jam 9:30 malam ini menerusi saluran TVIQ 610! Selamat menonton semua :)','','','2015-06-21 04:31:19','2015-06-30 07:24:49',NULL,NULL),(558,'instagram','1011997575308031745_211454780','photo','Dah tweet soalan anda belum? Cepat, cepat.. Mereka sedang menanti tweet anda. Hantarkan soalan berserta hashtag #OhMyEnglish dan mereka akan menjawab secara \'LIVE\' hari Ahad ini mulai jam 6 petang! @afeeqemir @officialjuzzthin @akhmalnazri','https://scontent.cdninstagram.com/hphotos-xaf1/t51.2885-15/e15/11313411_982438705113847_1429132688_n.jpg','https://instagram.com/p/4LVm7VyrcB/','2015-06-21 04:05:33','2015-06-30 07:24:49',NULL,NULL),(559,'facebook','227747950638855_871536999593277','text','Oh My English Can You Just Put at Youtube Every Single Episode Of OME? I always Missed..... Then For Repeat I Always Got H/w','','','2015-06-21 03:59:09','2015-06-30 07:24:49',NULL,NULL),(560,'facebook','227747950638855_871485846265059','text','Peminat-peminat kucing sekalian… kini anda ada \'geng\' kerana Ed Sheeran juga suka pada kucing! Jangan lupa saksikannya dalam episod terbaru Oh My English! Class of 2015 pada HARI INI jam 6:30 petang (sebentar LAGI!) menerusi saluran TVIQ 610 & Maya HD 135','','','2015-06-21 02:10:55','2015-06-30 07:24:49',NULL,NULL),(561,'facebook','227747950638855_871462806267363','text','Siapa yang PALING LAYAK untuk menjadi pengawas SMK Ayer Dalam? Jom undi sekarang!','','','2015-06-21 00:29:45','2015-06-30 07:24:49',NULL,NULL),(562,'facebook','124671317599433_868569843209573','text','Pilihan raya pengawas-pengawas baru di kalangan Tingkatan 3 sedang dijalankan di SMK Ayer Dalam. Pelajar-pelajar senior merancang pelbagai taktik kotor untuk memenangi undi, dan pelajar-pelajar junior terperangkap dalam helah mereka. Sementara itu, Taylor','','','2015-06-21 00:11:49','2015-06-30 07:24:49',NULL,NULL);
