INSERT INTO `t9431_log_facebook_feed` VALUES (1,'227747950638855_868870889859888','photo','added_photos','Did you know that Taylor snorts when she laughs? That\'s hilarious! To find out more fun facts about your other favourite characters, log on to www.ohmyenglish.com.my!','https://scontent.xx.fbcdn.net/hphotos-xfp1/v/t1.0-9/10372042_868870889859888_5046942589807803310_n.png?oh=178717bf5d70caca3e779f9220fbebb8&oe=55F48EF5','2015-06-15 19:40:32','2015-06-16 09:20:47',''),(2,'227747950638855_868651436548500','photo','added_photos','Make sure you know the difference between these two words :)','https://fbcdn-sphotos-b-a.akamaihd.net/hphotos-ak-xaf1/v/t1.0-9/11403450_868651436548500_819654092362481179_n.png?oh=b4b9bbfd53c1eac1f25cf317baf955b1&oe=55F57F7D&__gda__=1441217027_7a5040bb78bad457e33963144cbeb401','2015-06-15 06:45:38','2015-06-16 09:20:47',''),(3,'227747950638855_868648336548810','status','wall_post','awesome i can wait to watch it\'s','','2015-06-15 06:30:20','2015-06-16 09:20:47',''),(4,'227747950638855_868156876597956','video','shared_story','Jangan lupa tonton episod terbaru \'Oh My English! Class of 2015\' minggu hadapan kerana Taylor Marie Smith akan muncul serta ada penampilan khas oleh ED SHEERAN! Wuuuuhuuu pasti seronok habis. Kongsi video ini bersama rakan-rakan anda ya!','','2015-06-14 03:08:58','2015-06-16 09:20:47',''),(5,'227747950638855_867814476632196','photo','added_photos','Berjayakah SYS menyelamatkan Jibam daripada terus terjerumus dalam aktiviti buli di sekolah? Nantikan episod terbaru \'Oh My English! Class of 2015\' esok, jam 6:30 petang, menerusi saluran TVIQ & Maya HD untuk mengetahui jawapannya!','https://fbcdn-sphotos-a-a.akamaihd.net/hphotos-ak-xat1/v/t1.0-9/11391097_867814476632196_3144147615425587879_n.png?oh=3fdb3497735dd462bdd692e44680c4fe&oe=55F60DBF&__gda__=1445892448_51ececa87bfcc6ae72977499fdb9a51b','2015-06-13 05:51:54','2015-06-16 09:20:48',''),(6,'227747950638855_867758923304418','status','wall_post','jibam minum vitagen untuk perut hadam','','2015-06-13 02:24:10','2015-06-16 09:20:48',''),(7,'227747950638855_867479179999059','photo','added_photos','Alamak... Puan Aida dah marah! Tahu tak kenapa?','https://scontent.xx.fbcdn.net/hphotos-xpt1/v/t1.0-9/11377207_867479179999059_1299786798605742422_n.png?oh=fb8c08afaab80be43cd08d193a11e1dd&oe=55F152FB','2015-06-12 07:19:08','2015-06-16 09:20:48',''),(8,'227747950638855_867409706672673','photo','added_photos','5 suara, 1 juara! Siapakah bakal juara Ceria Popstar 3? Saksikan Konsert Kemuncak MALAM INI, jam 9 malam di saluran Astro Ceria (611)!  #ceriapopstar','https://scontent.xx.fbcdn.net/hphotos-xfa1/v/t1.0-9/11377217_867409706672673_6713328418203459536_n.jpg?oh=67114a423d3d7aadc05f9173f43984d3&oe=55FA33FD','2015-06-12 03:07:20','2015-06-16 09:20:48',''),(9,'227747950638855_866985296715114','video','shared_story','Adakah Jibam dan SYS akan kembali menjadi BFF? Nantikan jawapannya dalam \'Oh My English! Class of 2015\' pada hari Ahad ini, jam 6:30 petang, menerusi saluran Astro TVIQ 610& Astro Maya HD 135!','','2015-06-11 04:15:00','2015-06-16 09:20:48',''),(10,'227747950638855_866674413412869','video','added_video','Don\'t forget to catch the next episod of \'Oh My English! Class of 2015\' this Sunday, 6:30 pm via Astro TVIQ 610 & Astro Maya HD 135! Azzam Sham Supporters Azzam Sham Juliana Evans (official) Juliana Evans Juzzthin','','2015-06-10 07:14:21','2015-06-16 09:20:48',''),(11,'227747950638855_866557236757920','status','wall_post','i am not come Back,','','2015-06-10 03:47:00','2015-06-16 09:20:48',''),(12,'227747950638855_866534396760204','status','wall_post','soΠg, @$.?','','2015-06-10 03:09:41','2015-06-16 09:20:48',''),(13,'227747950638855_866534210093556','status','wall_post','i am not come Back,,','','2015-06-10 03:08:37','2015-06-16 09:20:48',''),(14,'227747950638855_866472773433033','status','wall_post','OME! OMG!','','2015-06-09 22:52:39','2015-06-16 09:20:48',''),(15,'227747950638855_866065523473758','photo','added_photos','Weeee tak sabarnya nak tengok MeleTop malam ini kerana ada Zack, Taylor dan Sayur! Kamu semua jangan lupa tonton juga tau, jam 9:00 malam menerusi saluran Astro Ria 104! Juzzthin Juliana Evans Juliana Evans (official) Azzam Sham - Fanz Club Azzam Sham Sup','https://fbcdn-sphotos-c-a.akamaihd.net/hphotos-ak-xpa1/v/t1.0-9/1456762_866065523473758_7671002173652304616_n.jpg?oh=0d95533814426dfa68bc6198ad684791&oe=562E1F31&__gda__=1441383180_e3b1cba69220988fdeb6047e98f12123','2015-06-09 01:40:07','2015-06-16 09:20:49',''),(16,'227747950638855_866052420141735','status','wall_post','best gile cerita oh my English....','','2015-06-09 01:00:26','2015-06-16 09:20:49',''),(17,'227747950638855_866041273476183','photo','added_photos','Apakah jawapannya? Haaa.. letakkan jawapan anda menerusi permainan \'Feed Henry\' yang boleh di dapati di www.ohmyenglish.com.my! Semoga berjaya menjawab semua soalan ya!','https://scontent.xx.fbcdn.net/hphotos-xtf1/v/t1.0-9/11390197_866041273476183_1486033887047185738_n.png?oh=ee1473d42e5f3385fb609b8723b2d36f&oe=5629A352','2015-06-08 23:46:30','2015-06-16 09:20:49',''),(18,'227747950638855_865520393528271','photo','added_photos','All of us at Astro extend our heartfelt condolences to the families and loved ones of the victims of the Sabah earthquake. #StayStrongSabah','https://fbcdn-sphotos-h-a.akamaihd.net/hphotos-ak-xtf1/t31.0-8/11336983_865520393528271_7258806184482685_o.jpg','2015-06-07 18:21:25','2015-06-16 09:21:01',''),(19,'227747950638855_865191543561156','status','wall_post','Oh My English! Class of 2015 - Ending Bloopers\n(No Have!) (Before!) :)','','2015-06-07 05:46:47','2015-06-16 09:21:01',''),(20,'227747950638855_865176470229330','video','shared_story','Apa dia? Tak sempat tengok episod pertama \'Oh My English! Class of 2015\'? Jangan bersedih kerana anda boleh tonton episod tersebut (secara PENUH tau!) menerusi laman berikut : https://www.youtube.com/watch?v=rJFBZIuf3s8\n\nSelamat menonton!','','2015-06-07 04:49:21','2015-06-16 09:21:01',''),(21,'227747950638855_865103550236622','status','wall_post','Heloo','','2015-06-07 01:08:48','2015-06-16 09:21:01',''),(22,'227747950638855_865102876903356','status','wall_post','Kwq','','2015-06-07 01:04:18','2015-06-16 09:21:01',''),(23,'227747950638855_875316015882042','photo','added_photos','Argghhh!!! Mr. Middleton has had enough! Can you guess what it is?','https://scontent.xx.fbcdn.net/hphotos-xfp1/v/t1.0-9/10995364_875316015882042_5159723412832368315_n.png?oh=d22d5d359151b49467c09bc36e11594a&oe=561F6299','2015-06-29 04:43:03','2015-06-30 07:24:43',''),(24,'227747950638855_874892512591059','photo','added_photos','Satu teladan dapat dipelajari dari kisah Jibam & SYS ini. Apakah teladan tersebut?','https://fbcdn-sphotos-g-a.akamaihd.net/hphotos-ak-xtp1/v/t1.0-9/11709625_874892512591059_1110648277515202210_n.jpg?oh=bc01b9a62691f67626ba5e29b6277c94&oe=55E83A69&__gda__=1444094303_bad02f8d5373d2b799fcff3e0c04d4ca','2015-06-28 06:10:10','2015-06-30 07:24:44',''),(25,'227747950638855_874063372673973','photo','added_photos','\'Safety\' means \'the condition of being protected from or unlikely to cause danger, risk, or injury\'. Where do you usually hear this word?','https://scontent.xx.fbcdn.net/hphotos-xfa1/v/t1.0-9/11666060_874063372673973_4948671795056368956_n.png?oh=23f181791769e89db283d8253809b4b5&oe=561B723A','2015-06-27 19:19:00','2015-06-30 07:24:44',''),(26,'227747950638855_874056386008005','photo','added_photos','Help! We heard Cikgu Ayu is trapped in the room. What do you think SYS and Jibam should do? \nA) Try to kick the door open \nB) Get help from others \nC) Continue to panic \nD) Give motivation to Cikgu Ayu','https://scontent.xx.fbcdn.net/hphotos-xfp1/v/t1.0-9/11163239_874056386008005_6809237836186797781_n.png?oh=1179bc466f4f994e44049e0a99201250&oe=561991EC','2015-06-26 18:50:00','2015-06-30 07:24:44',''),(27,'227747950638855_874047296008914','photo','added_photos','Let\'s learn some words that are associated with a fireman!','https://scontent.xx.fbcdn.net/hphotos-xfa1/v/t1.0-9/10421258_874047296008914_2644081506615695464_n.png?oh=23975f67465884a5724cb40fdc7d2fe9&oe=561ECA10','2015-06-26 06:14:47','2015-06-30 07:24:44',''),(28,'227747950638855_873575952722715','photo','added_photos','We all make mistakes. Let’s make amends. Don’t wait too long, lets #kosongkosong. Share your stories at www.kosongkosong.com.my','https://scontent.xx.fbcdn.net/hphotos-xtf1/v/t1.0-9/11143418_873575952722715_3247015707978025564_n.jpg?oh=c877a35ad8f5c6f1dba49a04e27b8cf2&oe=56337DF3','2015-06-25 03:00:01','2015-06-30 07:24:45',''),(29,'227747950638855_873554126058231','photo','added_photos','Alamak! Jibam terperangkap dalam kelas! Komen \"Tolong Jibam\" atau \"Help Jibam\" cepat untuk selamatkannya!','https://scontent.xx.fbcdn.net/hphotos-xpf1/v/t1.0-9/11667530_873554126058231_1793926604458646516_n.png?oh=44fdb237c11bd3b0bc23a0af00071d53&oe=55E91EBF','2015-06-25 00:15:45','2015-06-30 07:24:45',''),(30,'227747950638855_873217346091909','photo','added_photos','Remember both are nouns but have different meanings!','https://scontent.xx.fbcdn.net/hphotos-xpt1/v/t1.0-9/11209576_873217346091909_9123592132892143915_n.jpg?oh=e5c792e85a778558111940a8c75f9385&oe=55E727E7','2015-06-24 06:20:15','2015-06-30 07:24:45',''),(31,'227747950638855_872980176115626','photo','added_photos','Thank you for all the questions tweeted last Sunday! Zack, Zeeq & Jibam had a tremendous time answering them. Stay tuned for more live sessions and be sure to watch the next episode this Sunday, 6:30pm via TVIQ & Maya HD!','https://fbcdn-sphotos-a-a.akamaihd.net/hphotos-ak-xta1/v/t1.0-9/10313662_872980176115626_3058655569081918050_n.jpg?oh=8887ed83d1dffea7a35129f73990485a&oe=562796FE&__gda__=1446162807_1e5d98df61b3d08fa4d7e685b70bce55','2015-06-23 20:05:31','2015-06-30 07:24:46',''),(32,'227747950638855_872618969485080','status','wall_post','#sukasangatlayan\n#ohmyenglish\n#terbaikk','','2015-06-23 00:43:03','2015-06-30 07:24:46',''),(33,'227747950638855_872540572826253','video','added_video','Oh no! SMK Ayer Dalam is on fire! Who could be the cause of it? Find out this Sunday at 6:30 pm via Astro TVIQ 610 & Maya HD 135!','','2015-06-22 19:03:07','2015-06-30 07:24:46',''),(34,'227747950638855_872156766197967','status','wall_post','Kenapa tak masukkan semua episod oh my english ini?','','2015-06-22 00:49:41','2015-06-30 07:24:46',''),(35,'227747950638855_872074736206170','status','wall_post','where can i watch episode 2 ? only can find ep 1 and 3.','','2015-06-21 23:51:50','2015-06-30 07:24:46',''),(36,'227747950638855_872050122875298','video','shared_story','The full 3rd episode of #OhMyEnglish #Classof2015 is now available on our YouTube channel : https://www.youtube.com/watch?v=lhGbXbCmwww. Have fun watching it!','','2015-06-21 22:20:46','2015-06-30 07:24:46',''),(37,'227747950638855_871548629592114','status','mobile_status_update','Tak sempat tonton episod ke-3 tadi? Jangan risau, siaran ulangan akan bermula pada jam 9:30 malam ini menerusi saluran TVIQ 610! Selamat menonton semua :)','','2015-06-21 04:31:19','2015-06-30 07:24:46',''),(38,'227747950638855_871536999593277','status','wall_post','Oh My English Can You Just Put at Youtube Every Single Episode Of OME? I always Missed..... Then For Repeat I Always Got H/w','','2015-06-21 03:59:09','2015-06-30 07:24:46',''),(39,'227747950638855_871485846265059','photo','added_photos','Peminat-peminat kucing sekalian… kini anda ada \'geng\' kerana Ed Sheeran juga suka pada kucing! Jangan lupa saksikannya dalam episod terbaru Oh My English! Class of 2015 pada HARI INI jam 6:30 petang (sebentar LAGI!) menerusi saluran TVIQ 610 & Maya HD 135','https://scontent.xx.fbcdn.net/hphotos-xtf1/v/t1.0-9/10434380_871485846265059_7121031820295261017_n.jpg?oh=dc5a81c16ae2705b41bcc22e6bb73cb2&oe=56343228','2015-06-21 02:10:55','2015-06-30 07:24:46',''),(40,'227747950638855_871462806267363','photo','added_photos','Siapa yang PALING LAYAK untuk menjadi pengawas SMK Ayer Dalam? Jom undi sekarang!','https://fbcdn-sphotos-h-a.akamaihd.net/hphotos-ak-xtf1/v/t1.0-9/11257868_871462806267363_4658249193560867519_n.png?oh=833fcb5b16b361aa1c2e2f632de63e90&oe=56350AA7&__gda__=1444686588_e13d7cf3943923b1fdf52492b65c4511','2015-06-21 00:29:45','2015-06-30 07:24:46',''),(41,'124671317599433_868569843209573','video','shared_story','Pilihan raya pengawas-pengawas baru di kalangan Tingkatan 3 sedang dijalankan di SMK Ayer Dalam. Pelajar-pelajar senior merancang pelbagai taktik kotor untuk memenangi undi, dan pelajar-pelajar junior terperangkap dalam helah mereka. Sementara itu, Taylor','','2015-06-21 00:11:49','2015-06-30 07:24:46',''),(42,'227747950638855_870954126318231','photo','added_photos','Any Swiftie out there who can confirm if this is true? =P','https://fbcdn-sphotos-b-a.akamaihd.net/hphotos-ak-xaf1/v/t1.0-9/10991412_870954126318231_8646299400591043942_n.jpg?oh=b50b827c35fa14b9d19bbb6e93990de1&oe=56178FCA&__gda__=1441251195_945dd4625da2cc47eab09ab0c6ed2bbf','2015-06-20 05:43:22','2015-06-30 07:24:47',''),(43,'227747950638855_870847156328928','photo','added_photos','Ketika sedang sibuk menunggu kemunculan Ed Sheeran, marilah tweet bersama hashtag #OhMyEnglish untuk tanya soalan kepada Jibam, Zeeq & Zack! Soalan akan mungkin akan dijawab secara \'LIVE\' ESOK jam 6 petang!','https://scontent.xx.fbcdn.net/hphotos-xpf1/v/t1.0-9/10153020_870847156328928_4724926610684480820_n.jpg?oh=54cb8424a5cf2d98e7ec1a31fbc53b55&oe=561AEF43','2015-06-19 23:44:24','2015-06-30 07:24:47',''),(44,'227747950638855_870842919662685','status','wall_post','Macam mana nk buat karangan','','2015-06-19 23:19:40','2015-06-30 07:24:47',''),(45,'227747950638855_870726909674286','status','wall_post','Pls upload oh my english season 4 episode 2\nIm waiting.....','','2015-06-19 20:14:45','2015-06-30 07:24:47',''),(46,'227747950638855_870667799680197','photo','added_photos','We would like to wish all our Muslim friends a blessed Ramadan al-Mubarak. #kosongkosong','https://fbcdn-sphotos-f-a.akamaihd.net/hphotos-ak-xpf1/v/t1.0-9/10411137_870667799680197_4936438774878634530_n.jpg?oh=27bb6b6c32e02c635a66dd46bc65857b&oe=561F7B62&__gda__=1446066184_f9346de4a14f09dc67402de2672993d2','2015-06-19 16:45:31','2015-06-30 07:24:47',''),(47,'227747950638855_870342216379422','status','wall_post','Kenapa mr.midelton gemuk macam beruk?','','2015-06-19 05:36:32','2015-06-30 07:24:47','');
