INSERT INTO `t9433_log_instagram_feed` VALUES (1,'1007978036706587732_211454780','image','What was #Zack\'s pick-up line? Can you refresh our memory? :p #OhMyEnglish #Classof2015 @officialjuzzthin','https://scontent.cdninstagram.com/hphotos-xfa1/t51.2885-15/e15/11417423_1082110481802442_633250470_n.jpg','','https://instagram.com/p/39Dq8TSrRU/','2015-06-15 14:59:27','2015-06-16 09:21:03',''),(2,'1007143833328858669_211454780','video','Ada pelajar baru di SMK Ayer Dalam? Siapa yang akan dilantik sebagai pengawas?! Eh, Zeeq berbual dengan @teddysphotos ke tu?! Oh My Gucci! Macam-macam akan berlaku dalam episod terbaru #OhMyEnglish #Classof2015 pada hari Ahad, 6:30 ptg menerusi saluran #T','https://scontent.cdninstagram.com/hphotos-xaf1/t51.2885-15/e15/11333602_696891250438976_965991257_n.jpg','https://scontent.cdninstagram.com/hphotos-xaf1/t50.2886-16/11538388_1612614328986687_1260459099_n.mp4','https://instagram.com/p/36F_r3SrYt/','2015-06-14 11:22:02','2015-06-16 09:21:03',''),(3,'1007112211221100405_211454780','image','#Repost @queenqya with @repostapp.\n・・・\nBack to school on a Sunday with Cik Ayu #OhMyEnglish #OME2015','https://scontent.cdninstagram.com/hphotos-xfa1/t51.2885-15/e15/11357894_959591380760196_1700432923_n.jpg','','https://instagram.com/p/35-zheyrd1/','2015-06-14 10:19:12','2015-06-16 09:21:03',''),(4,'1007111530619778918_211454780','image','#Repost @akhmalnazri with @repostapp.\n・・・\nWhat is going on between Jibam and Sayur!??Kalau nak tahu ,jangan lupa saksikan Jibam and Sayur dalam @ohmyenglish #ClassOf2015 sekejap lagi 6.30pm hanya di Astro Tviq and Maya HD! ','https://scontent.cdninstagram.com/hphotos-xaf1/t51.2885-15/e15/11372346_379006005643934_269054399_n.jpg','','https://instagram.com/p/35-pnnyrdm/','2015-06-14 10:17:51','2015-06-16 09:21:03',''),(5,'1007058412964067118_211454780','image','#Repost @roaxtan with @repostapp.\n・・・\nI can\'t waaaaait to start school again at SMK Ayer Dalam but wait... Why has Jibam changed? Can I save him before it\'s too late? Watch me rescue him today  on #OhMyEnglish Class of 2015, 6:30pm only on TVIQ & Maya HD!','https://scontent.cdninstagram.com/hphotos-xfa1/t51.2885-15/e15/11325431_600417130061025_1418665911_n.jpg','','https://instagram.com/p/35ykp8yrcu/','2015-06-14 08:32:19','2015-06-16 09:21:03',''),(6,'1007057173043918623_211454780','image','#Repost @nazrief_nazri with @repostapp.\n・・・\nManis betullah senyuman Cikgu Ayu.. Rasa-rasa kamu dia akan keluar dengan saya tak kalau saya ajak? :P Saksikan #OhMyEnglish Class of 2015 HARI INI jam 6:30 ptg menerusi saluran TVIQ 610 & Maya HD 135\n\n#nazriefo','https://scontent.cdninstagram.com/hphotos-xaf1/t51.2885-15/e15/11334399_1108662222484538_1646422165_n.jpg','','https://instagram.com/p/35ySnLyrcf/','2015-06-14 08:29:51','2015-06-16 09:21:03',''),(7,'1007056662555178766_211454780','image','#Repost @azzam_sham with @repostapp.\n・・・\nTak seronok betul kena buli minggu lepas tapi takpe! Semangat pergi ke sekolah tetap diteruskan lagi-lagi sebab dengar cerita ada \"drama\" di antara dua \'senior\' Sayur! Ish.. Nantikan kesudahannya dalam episod terba','https://scontent.cdninstagram.com/hphotos-xaf1/t51.2885-15/e15/11325364_492323700920990_1966693298_n.jpg','','https://instagram.com/p/35yLLwSrcO/','2015-06-14 08:28:50','2015-06-16 09:21:03',''),(8,'1006999123834615244_211454780','image','#Repost @akhmalnazri with @repostapp.\n・・・\nAlamak... Takutnya hari Ahad ini... Nanti kena panggil dengan Puan Aida la.. Alamak.. Tolong saya kawan-kawan! Saya terpaksa.. Bukan sengaja! Saksikan apa terjadi kepada saya dalam #OhMyEnglish Class of 2015 pada ','https://scontent.cdninstagram.com/hphotos-xaf1/t51.2885-15/e15/11312289_701033406693010_654449737_n.jpg','','https://instagram.com/p/35lF4pSrXM/','2015-06-14 06:34:31','2015-06-16 09:21:03',''),(9,'1006539810116646551_211454780','image','Alamak! Apa yang terjadi pada Mr. Middleton?! Macam lain macam je.... Ketahui selanjutnya dalam episod terbaru #OhMyEnglish! Class of 2015 esok, 6:30 p